import React, { useState } from 'react';
import { Shield, AlertTriangle, CheckCircle } from 'lucide-react';

const Card = ({ children, className }) => (
  <div className={`bg-white rounded-lg shadow ${className}`}>{children}</div>
);

const CardHeader = ({ children }) => <div className="p-4 border-b">{children}</div>;
const CardTitle = ({ children }) => <h2 className="text-lg font-semibold">{children}</h2>;
const CardContent = ({ children }) => <div className="p-4">{children}</div>;
const Input = ({ ...props }) => <input className="border rounded p-2 w-full" {...props} />;
const Button = ({ children, ...props }) => (
  <button className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700" {...props}>{children}</button>
);

const WebRiskDemo = () => {
  const [url, setUrl] = useState('');
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(false);

  const getStatusFromScores = (scores) => {
    return scores.some(score => score.confidenceLevel !== 'SAFE') ? 'threat' : 'safe';
  };

  const handleSubmit = async () => {
    setLoading(true);
    try {
      const response = await fetch('/api/scan', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ url })
      });

      const data = await response.json();

      setResults([{
        id: Date.now(),
        url,
        status: getStatusFromScores(data.scores),
        timestamp: new Date().toISOString(),
        scores: data.scores,
      }, ...results]);
    } catch (error) {
      setResults([{
        id: Date.now(),
        url,
        status: 'error',
        timestamp: new Date().toISOString(),
        error: 'Failed to scan URL'
      }, ...results]);
    }

    setLoading(false);
    setUrl('');
  };

  const getConfidenceBadgeColor = (level) => {
    switch (level) {
      case 'EXTREMELY_HIGH': return 'bg-red-100 text-red-700';
      case 'HIGH': return 'bg-orange-100 text-orange-700';
      case 'MEDIUM': return 'bg-yellow-100 text-yellow-700';
      case 'LOW': return 'bg-blue-100 text-blue-700';
      default: return 'bg-green-100 text-green-700';
    }
  };

  return (
    <div className="max-w-4xl mx-auto p-6 space-y-6">
      <Card className="bg-white">
        <CardHeader>
          <CardTitle className="flex items-center gap-2">
            <Shield className="h-6 w-6 text-blue-600" />
            Google Cloud Web Risk Demo
          </CardTitle>
        </CardHeader>
        <CardContent>
          <div className="flex gap-4">
            <Input
              value={url}
              onChange={(e) => setUrl(e.target.value)}
              placeholder="Enter URL to scan..."
              className="flex-1"
            />
            <Button 
              onClick={handleSubmit}
              disabled={!url || loading}
              className="bg-blue-600 hover:bg-blue-700"
            >
              {loading ? 'Scanning...' : 'Scan URL'}
            </Button>
          </div>

          <div className="mt-8 space-y-4">
            {results.map((result) => (
              <Card key={result.id} className="bg-gray-50">
                <CardContent className="pt-6">
                  <div className="space-y-4">
                    <div className="flex items-start justify-between">
                      <div className="space-y-2">
                        <div className="font-medium break-all">{result.url}</div>
                        <div className="text-sm text-gray-500">
                          Scanned at: {new Date(result.timestamp).toLocaleString()}
                        </div>
                      </div>
                      <div className="flex items-center gap-2">
                        {result.status === 'safe' ? (
                          <CheckCircle className="h-6 w-6 text-green-500" />
                        ) : (
                          <AlertTriangle className="h-6 w-6 text-red-500" />
                        )}
                      </div>
                    </div>

                    {result.scores && (
                      <div className="space-y-2">
                        <div className="font-medium">Threat Assessment:</div>
                        <div className="grid grid-cols-1 gap-2">
                          {result.scores.map((score) => (
                            <div key={score.threatType} className="flex justify-between items-center p-2 bg-white rounded">
                              <span>{score.threatType}</span>
                              <span className={`px-2 py-1 text-xs rounded ${getConfidenceBadgeColor(score.confidenceLevel)}`}>
                                {score.confidenceLevel}
                              </span>
                            </div>
                          ))}
                        </div>
                      </div>
                    )}
                  </div>
                </CardContent>
              </Card>
            ))}

            {results.length === 0 && (
              <div className="text-center py-8 text-gray-500">
                No scans performed yet. Enter a URL above to begin.
              </div>
            )}
          </div>
        </CardContent>
      </Card>
    </div>
  );
};

export default WebRiskDemo;
